import React from 'react';

const Home = () => {
  return (
    <div className="main-container">
      <aside></aside>
      <main>
        <header>
          <ul className="nav">
            <li>
              <h5>Code Reviewer's Dashboard</h5>
            </li>
          </ul>
        </header>
      </main>
    </div>
  );
};

export default Home;
